import React from 'react';
import './App.css';
import 'antd/dist/antd.css';
import {Layout} from 'antd';
import Header from './components/Header';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

import Home from './components/Home';
import CoronaCard from './components/CoronaCard';
import CoronaChart from './components/CoronaChart';

function App() {
  return (
    <Router>
    <Layout className="layout">
    <Layout.Header>
      <Header/>
    </Layout.Header>

    <Layout.Content style={{ padding: '0 50px' }}>

      <Route path="/" exact render={(props)=>{

        return <Home {...props}/>

      }}/>

      <Route path="/cards" render={(props)=>{

        return <CoronaCard {...props}/>

      }}/>

       <Route path="/charts" render={(props)=>{

        return <CoronaChart {...props}/>

      }}/>

    </Layout.Content>


    <Layout.Footer style={{ textAlign: 'center' }}>Ant Design Â©2018 Created by Ant UED</Layout.Footer>


  </Layout>
  </Router>
  );
}

export default App;
